DROP TABLE IF EXISTS SCHEDULE;
DROP TABLE IF EXISTS STATION;
DROP TABLE IF EXISTS TRAIN;
DROP TABLE IF EXISTS TRAIN_ALERTS;
DROP TABLE IF EXISTS TRAIN_HOLIDAYS;
DROP TABLE IF EXISTS GOVRE_STATION;
DROP TABLE IF EXISTS trips;
DROP TABLE IF EXISTS stops;
DROP TABLE IF EXISTS stop_times;
DROP TABLE IF EXISTS shapes;
DROP TABLE IF EXISTS routes;
DROP TABLE IF EXISTS calendar_dates;
DROP TABLE IF EXISTS calendar;
DROP TABLE IF EXISTS agency;
DROP TABLE IF EXISTS vehicles;
DROP TABLE IF EXISTS updates;
DROP TABLE IF EXISTS GTFS_UPDATE_TRACKER;
CREATE TABLE TRAIN_ALERTS (TRAIN_NUM TEXT, ALERT_MESSAGE TEXT, DT_UPDATED TEXT, MINUTES_DELAY TEXT, TRAIN_DELAYED TEXT, TRAIN_CANCELLED TEXT);
CREATE TABLE GOVRE_STATION (stop_id TEXT NOT NULL, ADDRESS  TEXT NOT NULL, CITY TEXT NOT NULL, [STATE] TEXT NOT NULL, ZIP TEXT NOT NULL, URL TEXT NOT NULL, [ZONE] TEXT NOT NULL, SORT_ORDER INTEGER NOT NULL, [ABBREVIATION] TEXT NOT NULL);
CREATE TABLE [trips]([route_id] INTEGER,[service_id] TEXT,[trip_id] TEXT,[trip_headsign] TEXT,[trip_short_name] TEXT,[direction_id] INTEGER,[block_id] TEXT,[shape_id] INTEGER);
CREATE TABLE [stops]([stop_id] TEXT NOT NULL,[stop_code] TEXT,[stop_name] TEXT,[stop_desc] TEXT,[stop_lat] TEXT,[stop_lon] TEXT,[zone_id] TEXT,[stop_url] TEXT,[location_type] INTEGER,[parent_station] TEXT,[stop_timezone] TEXT);
CREATE TABLE [stop_times]([trip_id] TEXT,[arrival_time] TEXT,[departure_time] TEXT,[stop_id] TEXT,[stop_sequence] INTEGER,[stop_headsign] TEXT,[pickup_type] INTEGER,[drop_off_type] INTEGER,[shape_dist_traveled] TEXT);
CREATE TABLE [shapes]([shape_id] INTEGER,[shape_pt_lat] TEXT,[shape_pt_lon] TEXT,[shape_pt_sequence] INTEGER,[shape_dist_traveled] TEXT);
CREATE TABLE [routes]([route_id] INTEGER,[agency_id] TEXT,[route_short_name] TEXT,[route_long_name] TEXT,[route_desc] TEXT,[route_type] INTEGER,[route_url] TEXT,[route_color] TEXT,[route_text_color] TEXT);
CREATE TABLE [calendar_dates]([service_id] TEXT,[date] TEXT,[exception_type] INTEGER);
CREATE TABLE [calendar]([service_id] TEXT,[monday] INTEGER,[tuesday] INTEGER,[wednesday] INTEGER,[thursday] INTEGER,[friday] INTEGER,[saturday] INTEGER,[sunday] INTEGER,[start_date] TEXT,[end_date] TEXT);
CREATE TABLE [agency]([agency_id] TEXT,[agency_name] TEXT,[agency_url] TEXT,[agency_timezone] TEXT,[agency_lang] TEXT,[agency_phone] TEXT,[agency_fare_url] TEXT);
CREATE TABLE [vehicles]([vehicle_id] TEXT,[vehicle_label] TEXT,[vehicle_lat] TEXT,[vehicle_lon] TEXT,	[trip_id] TEXT, [route_id] INTEGER, [timestamp] TEXT,[stop_sequence] INTEGER,[stop_id] TEXT, [current_status] TEXT);
CREATE TABLE [updates]([trip_id] TEXT,[trip_schedule_relationship] TEXT,[route_id] INTEGER,[vehicle_id] TEXT,[vehicle_label] TEXT,[stop_sequence] INTEGER,[stop_id] TEXT,[stop_schedule_relationship] TEXT,[delay] INTEGER,[time] TEXT);
CREATE TABLE [GTFS_UPDATE_TRACKER]([FeedName] TEXT,[LastUpdated] TEXT);
